le"},{"name":".prettierignore","path":".prettierignore","contentType":"file"},{"name":".prettierignore.include","path":".prettierignore.include","contentType":"file"},{"name":".prettierrc.yaml","path":".prettierrc.yaml","contentType":"file"},{"name":".swaggo","path":".swaggo","contentType":"file"},{"name":"LICENSE","path":"LICENSE","contentType":"file"},{"name":"LICENSE.enterprise","path":"LICENSE.enterprise","contentType":"file"},{"name":"Makefile","path":"Makefile","contentType":"file"},{"name":"README.md","path":"README.md","contentType":"file"},{"name":"SECURITY.md","path":"SECURITY.md","contentType":"file"},{"name":"coder.env","path":"coder.env","contentType":"file"},{"name":"docker-compose.yaml","path":"docker-compose.yaml","contentType":"file"},{"name":"flake.lock","path":"flake.lock","contentType":"file"},{"name":"flake.nix","path":"flake.nix","contentType":"file"},{"name":"go.mod","path":"go.mod","contentType":"file"},{"name":"go.sum","path":"go.sum","contentType":"file"},{"name":"install.sh","path":"install.sh","contentType":"file"},{"name":"package.json","path":"package.json","contentType":"file"},{"name":"pnpm-lock.yaml","path":"pnpm-lock.yaml","contentType":"file"},{"name":"release.key","path":"release.key","contentType":"file"},{"name":"shell.nix","path":"shell.nix","contentType":"file"}],"totalCount":50}},"fileTreeProcessingTime":12.007846,"foldersToFetch":[],"reducedMotionEnabled":"system","repo":{"id":440752086,"defaultBranch":"main","name":"coder","ownerLogin":"coder","currentUserCanPush":false,"isFork":false,"isEmpty":false,"createdAt":"2021-12-21T22:08:52.000-08:00","ownerAvatar":"https://avatars.githubusercontent.com/u/95932066?v=4","public":true,"private":false,"isOrgOwned":true},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"main","listCacheKey":"v0:1697522073.0","canEdit":true,"refType":"branch","currentOid":"b5e5b39de21934a3fbfb491a6b62cfcd0c5fac78"},"path":"install.sh","currentUser":{"id":125505503,"login":"whitventures","userEmail":"whit.ventures@outlook.com"},"blob":{"rawLines":["#!/bin/sh","set -eu","","# Coder's automatic install script.","# See https://github.com/coder/coder#install","#","# To run:","# curl -L https://coder.com/install.sh | sh","","usage() {","\targ0=\"$0\"","\tif [ \"$0\" = sh ]; then","\t\targ0=\"curl -fsSL https://coder.com/install.sh | sh -s --\"","\telse","\t\tnot_curl_usage=\"The latest script is available at https://coder.com/install.sh","\"","\tfi","","\tcath <<EOF","Installs Coder.","It tries to use the system package manager if possible.","After successful installation it explains how to start Coder.","","Pass in user@host to install Coder on user@host over ssh.","The remote host must have internet access.","${not_curl_usage-}","Usage:","","  $arg0 [--dry-run] [--version X.X.X] [--edge] [--method detect] \\","        [--prefix ~/.local] [--rsh ssh] [user@host]","","  --dry-run","      Echo the commands for the install process without running them.","","  --version X.X.X","      Install a specific version instead of the latest.","","  --edge","      Install the latest edge version instead of the latest stable version.","","  --method [detect | standalone]","      Choose the installation method. Defaults to detect.","      - detect detects the system package manager and tries to use it.","        Full reference on the process is further below.","      - standalone installs a standalone release archive into /usr/local/bin","","  --prefix <dir>","      Sets the prefix used by standalone release archives. Defaults to /usr/local","      and the binary is copied into /usr/local/bin","      To install in \\$HOME, pass --prefix=\\$HOME/.local","","  --binary-name <name>","\t  Sets the name for the CLI in standalone release archives. Defaults to \"coder\"","\t  To use the CLI as coder2, pass --binary-name=coder2","\t  Note: in-product documentation will always refer to the CLI as \"coder\"","","  --rsh <bin>","      Specifies the remote shell for remote installation. Defaults to ssh.","","  --with-terraform","\t  Installs Terraform binary from https://releases.hashicorp.com/terraform/${TERRAFORM_VERSION}/ source","\t  alongside coder.","\t  This is great for if you are having issues with Coder installing terraform, or if you","\t  just want it on your base system aswell.","\t  This supports most systems, however if you are unsure yours is supported you can check","\t  the link above.","  --net-admin","\t  Adds \\`CAP_NET_ADMIN\\` to the installed binary. This allows Coder to","\t  increase network speeds, but has security implications.","\t  See: https://man7.org/linux/man-pages/man7/capabilities.7.html","\t  This only works on Linux based systems.","","","The detection method works as follows:","  - Debian, Ubuntu, Raspbian: install the deb package from GitHub.","  - Fedora, CentOS, RHEL, openSUSE: install the rpm package from GitHub.","  - Alpine: install the apk package from GitHub.","  - macOS:  if \\`brew\\` is available, install from the coder/coder Homebrew tap.","  - Otherwise, download from GitHub and install into \\`--prefix\\`.","","We build releases on GitHub for amd64, armv7, and arm64 on Windows, Linux, and macOS.","","When the detection method tries to pull a release from GitHub it will","fall back to installing standalone when there is no matching release for","the system's operating system and architecture.","","The installer will cache all downloaded assets into ~/.cache/coder","EOF","}","","echo_latest_version() {","\tif [ \"${EDGE-}\" ]; then","\t\tversion=\"$(curl -fsSL https://api.github.com/repos/coder/coder/releases | awk 'match($0,/.*\"html_url\": \"(.*\\/releases\\/tag\\/.*)\".*/)' | head -n 1 | awk -F '\"' '{print $4}')\"","\telse","\t\t# https://gist.github.com/lukechilds/a83e1d7127b78fef38c2914c4ececc3c#gistcomment-2758860","\t\tversion=\"$(curl -fsSLI -o /dev/null -w \"%{url_effective}\" https://github.com/coder/coder/releases/latest)\"","\tfi","\tversion=\"${version#https://github.com/coder/coder/releases/tag/}\"","\tversion=\"${version#v}\"","\techo \"$version\"","}","","echo_standalone_postinstall() {","\tif [ \"${DRY_RUN-}\" ]; then","\t\techo_dryrun_postinstall","\t\treturn","\tfi","","\tcath <<EOF","","Coder has been installed to","","  $STANDALONE_INSTALL_PREFIX/bin/$STANDALONE_BINARY_NAME","","EOF","","\tCODER_COMMAND=\"$(command -v \"$STANDALONE_BINARY_NAME\" || true)\"","","\tif [ -z \"${CODER_COMMAND}\" ]; then","\t\tcath <<EOF","Extend your path to use Coder:","","  $ PATH=\"$STANDALONE_INSTALL_PREFIX/bin:\\$PATH\"","","EOF","\telif [ \"$CODER_COMMAND\" != \"$STANDALONE_BINARY_LOCATION\" ]; then","\t\techo_path_conflict \"$CODER_COMMAND\"","\telse","\t\tcath <<EOF","To run a Coder server:","","  $ $STANDALONE_BINARY_NAME server","","To connect to a Coder deployment:","","  $ $STANDALONE_BINARY_NAME login <deployment url>","","EOF","\tfi","}","","echo_brew_postinstall() {","\tif [ \"${DRY_RUN-}\" ]; then","\t\techo_dryrun_postinstall","\t\treturn","\tfi","","\tBREW_PREFIX=\"$(brew --prefix)\"","","\tcath <<EOF","","Coder has been installed to","","  $BREW_PREFIX/bin/coder","","EOF","","\tCODER_COMMAND=\"$(command -v \"coder\" || true)\"","","\tif [ \"$CODER_COMMAND\" != \"$BREW_PREFIX/bin/coder\" ]; then","\t\techo_path_conflict \"$CODER_COMMAND\"","\tfi","","\tcath <<EOF","To run a Coder server:","","  $ coder server","","To connect to a Coder deployment:","","  $ coder login <deployment url>","","EOF","}","","echo_systemd_postinstall() {","\tif [ \"${DRY_RUN-}\" ]; then","\t\techo_dryrun_postinstall","\t\treturn","\tfi","","\techoh","\tcath <<EOF","$1 package has been installed.","","To run a Coder server:","","  # Start Coder now and on reboot","  $ sudo systemctl enable --now coder","  $ journalctl -u coder.service -b","","  # Or just run the server directly","  $ coder server","","  Configuring Coder: https://coder.com/docs/v2/latest/admin/configure","","To connect to a Coder deployment:","","  $ coder login <deployment url>","","EOF","}","","echo_dryrun_postinstall() {","\tcath <<EOF","Dry-run complete.","","To install Coder, re-run this script without the --dry-run flag.","","EOF","}","","echo_path_conflict() {","\tcath <<EOF","There is another binary in your PATH that conflicts with the binary we've installed.","","  $1","","This is likely because of an existing installation of Coder. See our documentation for suggestions on how to resolve this.","","\thttps://coder.com/docs/v2/latest/install/install.sh#path-conflicts","","EOF","}","","main() {","\tTERRAFORM_VERSION=\"1.3.4\"","","\tif [ \"${TRACE-}\" ]; then","\t\tset -x","\tfi","","\tunset \\","\t\tDRY_RUN \\","\t\tMETHOD \\","\t\tOPTIONAL \\","\t\tALL_FLAGS \\","\t\tRSH_ARGS \\","\t\tEDGE \\","\t\tRSH \\","\t\tWITH_TERRAFORM \\","\t\tCAP_NET_ADMIN","","\tALL_FLAGS=\"\"","","\twhile [ \"$#\" -gt 0 ]; do","\t\tcase \"$1\" in","\t\t-*)","\t\t\tALL_FLAGS=\"${ALL_FLAGS} $1\"","\t\t\t;;","\t\tesac","","\t\tcase \"$1\" in","\t\t--dry-run)","\t\t\tDRY_RUN=1","\t\t\t;;","\t\t--method)","\t\t\tMETHOD=\"$(parse_arg \"$@\")\"","\t\t\tshift","\t\t\t;;","\t\t--method=*)","\t\t\tMETHOD=\"$(parse_arg \"$@\")\"","\t\t\t;;","\t\t--prefix)","\t\t\tSTANDALONE_INSTALL_PREFIX=\"$(parse_arg \"$@\")\"","\t\t\tshift","\t\t\t;;","\t\t--prefix=*)","\t\t\tSTANDALONE_INSTALL_PREFIX=\"$(parse_arg \"$@\")\"","\t\t\t;;","\t\t--binary-name)","\t\t\tSTANDALONE_BINARY_NAME=\"$(parse_arg \"$@\")\"","\t\t\tshift","\t\t\t;;","\t\t--binary-name=*)","\t\t\tSTANDALONE_BINARY_NAME=\"$(parse_arg \"$@\")\"","\t\t\t;;","\t\t--version)","\t\t\tVERSION=\"$(parse_arg \"$@\")\"","\t\t\tshift","\t\t\t;;","\t\t--version=*)","\t\t\tVERSION=\"$(parse_arg \"$@\")\"","\t\t\t;;","\t\t--edge)","\t\t\tEDGE=1","\t\t\t;;","\t\t--rsh)","\t\t\tRSH=\"$(parse_arg \"$@\")\"","\t\t\tshift","\t\t\t;;","\t\t--rsh=*)","\t\t\tRSH=\"$(parse_arg \"$@\")\"","\t\t\t;;","\t\t-h | --h | -help | --help)","\t\t\tusage","\t\t\texit 0","\t\t\t;;","\t\t--with-terraform)","\t\t\tWITH_TERRAFORM=1","\t\t\t;;","\t\t--net-admin)","\t\t\tCAP_NET_ADMIN=1","\t\t\t;;","\t\t--)","\t\t\tshift","\t\t\t# We remove the -- added above.","\t\t\tALL_FLAGS=\"${ALL_FLAGS% --}\"","\t\t\tRSH_ARGS=\"$*\"","\t\t\tbreak","\t\t\t;;","\t\t-*)","\t\t\techoerr \"Unknown flag $1\"","\t\t\techoerr \"Run with --help to see usage.\"","\t\t\texit 1","\t\t\t;;","\t\t*)","\t\t\tRSH_ARGS=\"$*\"","\t\t\tbreak","\t\t\t;;","\t\tesac","","\t\tshift","\tdone","","\tif [ \"${RSH_ARGS-}\" ]; then","\t\tRSH=\"${RSH-ssh}\"","\t\techoh \"Installing remotely with $RSH $RSH_ARGS\"","\t\tcurl -fsSL https://coder.dev/install.sh | prefix \"$RSH_ARGS\" \"$RSH\" \"$RSH_ARGS\" sh -s -- \"$ALL_FLAGS\"","\t\treturn","\tfi","","\t# These can be overridden for testing but shouldn't normally be used as it can","\t# result in a broken coder.","\tOS=${OS:-$(os)}","\tARCH=${ARCH:-$(arch)}","\tTERRAFORM_ARCH=${TERRAFORM_ARCH:-$(terraform_arch)}","","\t# We can't reasonably support installing specific versions of Coder through","\t# Homebrew, so if we're on macOS and the `--version` flag was set, we should","\t# \"detect\" standalone to be the appropriate installation method. This check","\t# needs to occur before we set `VERSION` to a default of the latest release.","\tif [ \"$OS\" = \"darwin\" ] && [ \"${VERSION-}\" ]; then","\t\tMETHOD=standalone","\tfi","","\t# If we've been provided a flag which is specific to the standalone installation","\t# method, we should \"detect\" standalone to be the appropriate installation method.","\t# This check needs to occur before we set these variables with defaults.","\tif [ \"${STANDALONE_INSTALL_PREFIX-}\" ] || [ \"${STANDALONE_BINARY_NAME-}\" ]; then","\t\tMETHOD=standalone","\tfi","","\tMETHOD=\"${METHOD-detect}\"","\tif [ \"$METHOD\" != detect ] && [ \"$METHOD\" != standalone ]; then","\t\techoerr \"Unknown install method \\\"$METHOD\\\"\"","\t\techoerr \"Run with --help to see usage.\"","\t\texit 1","\tfi","","\t# These are used by the various install_* functions that make use of GitHub","\t# releases in order to download and unpack the right release.","\tCACHE_DIR=$(echo_cache_dir)","\tTERRAFORM_INSTALL_PREFIX=${TERRAFORM_INSTALL_PREFIX:-/usr/local}","\tSTANDALONE_INSTALL_PREFIX=${STANDALONE_INSTALL_PREFIX:-/usr/local}","\tSTANDALONE_BINARY_NAME=${STANDALONE_BINARY_NAME:-coder}","\tVERSION=${VERSION:-$(echo_latest_version)}","","\tdistro_name","","\tif [ \"${DRY_RUN-}\" ]; then","\t\techoh \"Running with --dry-run; the following are the commands that would be run if this were a real installation:\"","\t\techoh","\tfi","","\t# Start by installing Terraform, if requested","\tif [ \"${WITH_TERRAFORM-}\" ]; then","\t\twith_terraform","\tfi","","\t# Standalone installs by pulling pre-built releases from GitHub.","\tif [ \"$METHOD\" = standalone ]; then","\t\tif has_standalone; then","\t\t\tinstall_standalone","\t\t\texit 0","\t\telse","\t\t\techoerr \"There are no standalone releases for $ARCH\"","\t\t\techoerr \"Please try again without '--method standalone'\"","\t\t\texit 1","\t\tfi","\tfi","","\t# DISTRO can be overridden for testing but shouldn't normally be used as it","\t# can result in a broken coder.","\tDISTRO=${DISTRO:-$(distro)}","","\tcase $DISTRO in","\tdarwin) install_macos ;;","\t# The .deb and .rpm files are pulled from GitHub.","\tdebian) install_deb ;;","\tfedora | opensuse) install_rpm ;;","\t# We don't have GitHub releases that work on Alpine or FreeBSD so we have no","\t# choice but to use npm here.","\talpine) install_apk ;;","\t# For anything else we'll try to install standalone but fall back to npm if","\t# we don't have releases for the architecture.","\t*)","\t\techoh \"Unsupported package manager.\"","\t\techoh \"Falling back to standalone installation.\"","\t\tinstall_standalone","\t\t;;","\tesac","","\tif [ \"${CAP_NET_ADMIN:-}\" ]; then","\t\tcap_net_admin","\tfi","}","","cap_net_admin() {","\tif ! command_exists setcap && command_exists capsh; then","\t\techo \"Package 'libcap' not found. See install instructions for your distro: https://command-not-found.com/setcap\"","\t\treturn","\tfi","","\t# Make sure we'e allowed to add CAP_NET_ADMIN.","\tif sudo_sh_c capsh --has-p=CAP_NET_ADMIN; then","\t\tsudo_sh_c setcap CAP_NET_ADMIN=+ep \"$(command -v coder)\" || true","","\t# Unable to escalate perms, notify the user.","\telse","\t\techo \"Unable to setcap agent binary. Ensure the root user has CAP_NET_ADMIN permissions.\"","\tfi","}","","parse_arg() {","\tcase \"$1\" in","\t*=*)","\t\t# Remove everything after first equal sign.","\t\topt=\"${1%%=*}\"","\t\t# Remove everything before first equal sign.","\t\toptarg=\"${1#*=}\"","\t\tif [ ! \"$optarg\" ] && [ ! \"${OPTIONAL-}\" ]; then","\t\t\techoerr \"$opt requires an argument\"","\t\t\techoerr \"Run with --help to see usage.\"","\t\t\texit 1","\t\tfi","\t\techo \"$optarg\"","\t\treturn","\t\t;;","\tesac","","\tcase \"${2-}\" in","\t\"\" | -*)","\t\tif [ ! \"${OPTIONAL-}\" ]; then","\t\t\techoerr \"$1 requires an argument\"","\t\t\techoerr \"Run with --help to see usage.\"","\t\t\texit 1","\t\tfi","\t\t;;","\t*)","\t\techo \"$2\"","\t\treturn","\t\t;;","\tesac","}","","fetch() {","\tURL=\"$1\"","\tFILE=\"$2\"","","\tif [ -e \"$FILE\" ]; then","\t\techoh \"+ Reusing $FILE\"","\t\treturn","\tfi","","\tsh_c mkdir -p \"$CACHE_DIR\"","\tsh_c curl \\","\t\t-#fL \\","\t\t-o \"$FILE.incomplete\" \\","\t\t-C - \\","\t\t\"$URL\"","\tsh_c mv \"$FILE.incomplete\" \"$FILE\"","}","","with_terraform() {","\t# Check if the unzip package is installed. If not error peacefully.","\tif ! (command_exists unzip); then","\t\techoh","\t\techoerr \"This script needs the unzip package to run.\"","\t\techoerr \"Please install unzip to use this function\"","\t\texit 1","\tfi","\techoh \"Installing Terraform version $TERRAFORM_VERSION $TERRAFORM_ARCH from the HashiCorp release repository.\"","\techoh","","\t# Download from official source and save it to cache","\tfetch \"https://releases.hashicorp.com/terraform/${TERRAFORM_VERSION}/terraform_${TERRAFORM_VERSION}_${OS}_${TERRAFORM_ARCH}.zip\" \\","\t\t\"$CACHE_DIR/terraform_${TERRAFORM_VERSION}_${OS}_${TERRAFORM_ARCH}.zip\"","","\tsh_c mkdir -p \"$TERRAFORM_INSTALL_PREFIX\" 2>/dev/null || true","","\tsh_c=\"sh_c\"","\tif [ ! -w \"$TERRAFORM_INSTALL_PREFIX\" ]; then","\t\tsh_c=\"sudo_sh_c\"","\tfi","\t# Prepare /usr/local/bin/ and the binary for copying","\t\"$sh_c\" mkdir -p \"$TERRAFORM_INSTALL_PREFIX/bin\"","\t\"$sh_c\" unzip -d \"$CACHE_DIR\" -o \"$CACHE_DIR/terraform_${TERRAFORM_VERSION}_${OS}_${ARCH}.zip\"","\tCOPY_LOCATION=\"$TERRAFORM_INSTALL_PREFIX/bin/terraform\"","","\t# Remove the file if it already exists to","\t# avoid https://github.com/coder/coder/issues/2086","\tif [ -f \"$COPY_LOCATION\" ]; then","\t\t\"$sh_c\" rm \"$COPY_LOCATION\"","\tfi","","\t# Copy the binary to the correct location.","\t\"$sh_c\" cp \"$CACHE_DIR/terraform\" \"$COPY_LOCATION\"","}","","install_macos() {","\t# If there is no `brew` binary available, just default to installing standalone","\tif command_exists brew; then","\t\techoh \"Installing coder with Homebrew from the coder/coder tap.\"","\t\techoh","","\t\tsh_c brew install coder/coder/coder","","\t\techo_brew_postinstall","\t\treturn","\tfi","","\techoh \"Homebrew is not available.\"","\techoh \"Falling back to standalone installation.\"","\tinstall_standalone","}","","install_deb() {","\techoh \"Installing v$VERSION of the $ARCH deb package from GitHub.\"","\techoh","","\tfetch \"https://github.com/coder/coder/releases/download/v$VERSION/coder_${VERSION}_${OS}_${ARCH}.deb\" \\","\t\t\"$CACHE_DIR/coder_${VERSION}_$ARCH.deb\"","\tsudo_sh_c dpkg --force-confdef --force-confold -i \"$CACHE_DIR/coder_${VERSION}_$ARCH.deb\"","","\techo_systemd_postinstall deb","}","","install_rpm() {","\techoh \"Installing v$VERSION of the $ARCH rpm package from GitHub.\"","\techoh","","\tfetch \"https://github.com/coder/coder/releases/download/v$VERSION/coder_${VERSION}_${OS}_${ARCH}.rpm\" \\","\t\t\"$CACHE_DIR/coder_${VERSION}_${OS}_${ARCH}.rpm\"","\tsudo_sh_c rpm -U \"